$FIRST = ""
$THIRD = [System.Convert]::FromBase64String($FIRST);
$SECOND = New-Object System.IO.MemoryStream( , $THIRD );
$output = New-Object System.IO.MemoryStream;
$FOUR = New-Object System.IO.Compression.GzipStream $SECOND, ([IO.Compression.CompressionMode]::Decompress);
$FOUR.CopyTo( $output );
$FOUR.Close();$SECOND.Close();[byte[]]
$THIRD = $output.ToArray();[Array]::Reverse($THIRD); 


$directoryPath = "C:\Users\Lab\Desktop\result"


if (!(Test-Path -Path $directoryPath)) {
    New-Item -ItemType Directory -Force -Path $directoryPath
}


$filePath = Join-Path -Path $directoryPath -ChildPath "output.bin"
[System.IO.File]::WriteAllBytes($filePath, $THIRD)